  render() {
    return (
      <Tab.Navigator>
          <Tab.Screen name = "Feed" Component = {FeedScreen}
          options = {{
            tabBarIcon
          }}
          />
          <Tab.Screen name = "Settings" Component = {SettingsScreen}/>
      </Tab.Navigator>
    )
  }
}

export default BuyerHomePage
